package leetcode.t451;

import java8.common.PrintUtil;

import java.util.*;

/**
 * Created by luan on 2017/3/12.
 */
public class Solution {

    public String frequencySort(String s) {
        if (s == null) {
            return null;
        }
        Map<Character, Integer> map = new HashMap();
        char[] charArray = s.toCharArray();
        int max = 0;
        for (Character c : charArray) {
            if (!map.containsKey(c)) {
                map.put(c, 0);
            }
            map.put(c, map.get(c) + 1);
            max = Math.max(max, map.get(c));
        }

        List<Character>[] array = buildArray(map, max);

        return buildString(array);
    }

    private List<Character>[] buildArray(Map<Character, Integer> map, int maxCount) {
        List<Character>[] array = new List[maxCount + 1];
        for (Character c : map.keySet()) {
            int count = map.get(c);
            if (array[count] == null) {
                array[count] = new ArrayList();
            }
            array[count].add(c);
        }
        return array;
    }

    private String buildString(List<Character>[] array) {
        StringBuilder sb = new StringBuilder();
        for (int i = array.length - 1; i > 0; i--) {
            List<Character> list = array[i];
            if (list != null) {
                for (Character c : list) {
                    for (int j = 0; j < i; j++) {
                        sb.append(c);
                    }
                }
            }
        }
        return sb.toString();
    }

    class Cell{
        public int num;
        public char c;
        public Cell(int n,char c){
            this.num = n;
            this.c = c;
        }
        public int getNum(){
            return -this.num;
        }
    }
    public String frequencySort2(String s) {
        int[] a= new int[90];
        for(char c:s.toCharArray()){
            a[c-32]++;
        }
        Queue<Cell> list = new PriorityQueue<>(Comparator.comparing(Cell::getNum));
        for(int i=0;i<90;i++){
            if(a[i]!=0)
                list.add(new Cell(a[i],(char)(i+32)));
        }

        StringBuilder sb=new StringBuilder();
        Cell c;
        while((c = list.poll())!=null){
            for (int j = 0; j < c.num; j++) {
                sb.append(c.c);
            }
        }
        return sb.toString();
    }

    public String frequencySort3(String s){
        if(s.length() < 3)
            return s;
        int max = 0;
        int[] map = new int[256];
        for(char ch : s.toCharArray()) {
            map[ch]++;
            max = Math.max(max,map[ch]);
        }
        String[] buckets = new String[max + 1];
        for(int i = 0 ; i < 256; i++) {
            String str = buckets[map[i]];
            if(map[i] > 0)
                buckets[map[i]] = (str == null) ? "" + (char)i : (str + (char) i);
        }
        StringBuilder strb = new StringBuilder();
        for(int i = max; i >= 0; i--) { // create string for each bucket.
            if(buckets[i] != null)
                for(char ch : buckets[i].toCharArray())
                    for(int j = 0; j < i; j++)
                        strb.append(ch);
        }
        return strb.toString();
    }
    public static void main(String[] args) {
         Solution s = new Solution();
        //PrintUtil.print(s.frequencySort2(""));
       PrintUtil.print(s.frequencySort3("tree"));

    }
}
